const axios = require('axios')

export const getDatas = (): void => {
  const bla = axios.get('https://simple-blog-api.crew.red/posts')
    .then(function (response: any) {
      return response.data
    })
    .catch(function (error: any) {
      console.log(error)
    })

    console.log(bla)
}
